import { Col, Container, Row } from "react-bootstrap";
import "./App.css";

function App() {
  return (
    <Container fluid>
      <Row>
        <Col>Header</Col>
      </Row>
      <Row>
        <Col>Main menu</Col>
      </Row>
      <Row>
        <Col sm={2} md={2} className="d-none d-sm-block" style={{border:"1px solid green"}}>Left</Col>
        <Col sm={10} md={8} className="" style={{border:"1px solid green"}}>Main content</Col>
        <Col md={2} className="d-none d-sm-none d-md-block" style={{border:"1px solid green"}}>Right</Col>
      </Row>
      <Row>
        <Col>Footer</Col>
      </Row>
    </Container>
  );
}

export default App;
